Cooperative Task Executor is the default task executor in SwiftWasm. It is a simple single-threaded cooperative task executor implemented in Swift Concurrency library . If you are not familiar with "Cooperative" in concurrent programming term, see its definition for more details . This executor has an event loop that dispatches tasks until no more tasks are enqueued, and exits immediately after all tasks are dispatched. Note that this executor won't yield control to the host environment during execution, so any host's async operation cannot call back to the Wasm execution. This executor is suitable for WASI command line tools, or host-independent standalone applications. // USAGE
// $ swiftc -target wasm32-unknown-wasi -parse-as-library main.swift -o main.wasm
// $ wasmtime main.wasm
@main
struct Main { static func main() async throws { print("Sleeping for 1 second... 😴") try await Task.sleep(nanoseconds: 1_000_000_000) print("Wake up! 😁") }
}

