JavaScript Event Loop-based Task Executor is a task executor that cooperates with the JavaScript's event loop. It is provided by JavaScriptKit , and you need to activate it explicitly by calling a predefined JavaScriptEventLoop.installGlobalExecutor() function (see below for more details). This executor also has its own event loop that dispatches tasks until no more tasks are enqueued synchronously. It yields control to the JavaScript side after all pending tasks are dispatched, so JavaScript program can call back to the executed Wasm module. After a task is resumed by callbacks from JavaScript, the executor starts its event loop again in the next microtask tick. To enable this executor, you need to use JavaScriptEventLoop module, which is provided as a part of JavaScriptKit package. Ensure that you added JavaScriptKit dependency to your Package.swift Add JavaScriptEventLoop dependency to your targets that use this executor .product(name: "JavaScriptEventLoop", package: "JavaScriptKit"), Import JavaScriptEventLoop and call JavaScriptEventLoop.installGlobalExecutor() before spawning any tasks to activate the executor instead of the default cooperative executor. Note that this executor is only available on JavaScript host environment. See also JavaScriptKit package README for more details. import JavaScriptEventLoop
import JavaScriptKit JavaScriptEventLoop.installGlobalExecutor() let document = JSObject.global.document
var asyncButtonElement = document.createElement("button")
_ = document.body.appendChild(asyncButtonElement) asyncButtonElement.innerText = "Fetch Zen"
func printZen() async throws { let fetch = JSObject.global.fetch.function! let response = try await JSPromise(fetch("https://api.github.com/zen").object!)!.value let text = try await JSPromise(response.text().object!)!.value print(text)
}
asyncButtonElement.onclick = .object(JSClosure { _ in Task { do { try await printZen() } catch { print(error) } } return .undefined
})

